import React from "react";
import styled from "styled-components";
const Nav = styled.nav`
    display: flex;
    flex-direction: row;
    width: 100%;
    color: #bc5a5a;

    font-size: 1.4rem;
`;
const Menu = () => {
    return (
        <Nav>
            <li>home</li>
            <li>Cotnact</li>
        </Nav>
    );
};

export default Menu;
